import React from 'react';

const Cart = ({ onClose, cartItems, updateCartItems, openDelivery }) => {
  return (
    <div>
      <h3>Cart</h3>
      <button onClick={onClose}>Close</button>
      {cartItems.map(item => (
        <div key={item.id}>
          <p>{item.name} - {item.quantity} x {item.price} = {item.quantity * item.price}</p>
        </div>
      ))}
      <button onClick={openDelivery}>Proceed to Delivery</button>
    </div>
  );
};

export default Cart;
